import React, { Component } from "react";
import Grid from "@material-ui/core/Grid";
import ReactPlayer from "react-player";

class LandingPage extends Component {
  render() {
    return (
      <div>
        <div className="grid_root">
          <Grid container justify="center">
            {/* First Item */}
            <Grid item xs={12} sm={6} md={6} className="section">
              <ReactPlayer url="test.mp4" playing width="100%" height="100%"
              controls="true"/>
              <h2 className="overlay">Most Recent Project</h2>
            </Grid>

            <Grid item xs={12} sm={6} md={6}>
              <h1> Howe Yang </h1>
              <h2> Developer </h2>
              <h2>https://material-ui.com/components/grid/</h2>
            </Grid>
          </Grid>
        </div>
      </div>
    );
  }
}

export default LandingPage;
